import Link from "next/link";

const Navbar = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      ul {
        background: #333;
        color: #333;
        list-style: none;
        display: flex;
      }
    `}</style>
  </div>
);

export default Navbar;
